import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
	container: {
		paddingRight: "30",
	},
	button: {
		background: "#FAF9F9",
		borderRadius: "15px",
		marginLeft: theme.spacing(4),
		marginTop: theme.spacing(4),
		justifyContent: "left",
		width: "100%",
		color: "#D2D2D2",
		fontSize: "27px",
	},
	fontSizeInherit: {
		fontSize: "27px",
	},
}));
